import styled from 'styled-components';
import { grid } from 'styled-components-grid';

export const FeaturePanel = styled.header`
  ${grid({})}
`;

export const Feature = styled.div`
  ${grid.unit({ size: { tablet: 1 / 3 } })}
`;

export const Main = styled.main`
padding-bottom: 1em;	
`
